import React from  'react';
import logo from './logo.svg';
import './App.css';
import ClassList from './components/Classlist';
import Contacts from './components/Contacts';


class App extends React.Component {
  state = {
    persons: [
      {name: 'Kendall', number: "704-691-3105"},
      {name: 'Kenneth', number: "704-695-6709"},
      {name: 'Bridgette', number: "704-592-7308"}
    ],
    addContacts: false
  }

  render() {
    return (
    <div>
      <h1>Hello World </h1>
      <ClassList firstName="Kendall" lastName="Kee" phoneNumber="704-694-8706"/>
      <button onClick = {this.swithContactsHandler}>Switch Contacts</button>
      <Contacts name={this.state.persons[0].name} number={this.state.persons[0].number} />
      <Contacts name={this.state.persons[1].name} number={this.state.persons[1].number} />
      <Contacts name={this.state.persons[2].name} number={this.state.persons[1].number} />

    </div>
    )
  }
}
export default App;
